import React from "react";
//import { Link } from 'react-router-dom';
const Navbar = ()=>{
    return(
        <nav>
            <a href="#">HOME</a>
            <a href="#">ABOUT</a>
            <a href="#">TEAM</a>
            <a href="#">SERVICES</a>
            <a href="#">WORK</a>
            <a href="#">CLIENTS</a>
            <a href="#">CONTACT</a>
        </nav>
    )
}
export default Navbar
